import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css"; // simple styling for navbar

function Navbar() {
  return (
    <nav className="navbar">
      <div className="logo">HelpingHand NGO</div>
      <div className="nav-links">
        <Link to="/">Home</Link>
        <Link to="/donate-options">Donate</Link>
        <Link to="#">Login</Link>
        <Link to="#">Register</Link>
      </div>
    </nav>
  );
}

export default Navbar;
